import React, { Component } from "react";
import axios from "axios";
import {
    Button,
    Form,
    FormGroup,
    Input,
    Label
} from "reactstrap";


class AddMedicineOrder extends Component {

    constructor(props) {
        super(props);
        this.state = {
            customer: {
                id: null,
                name: "",
                surname: "",
                age: null
            },
            orderItems: []
        };
    }

    render () {
        return (
            <div>
                <h3>
                    Dodaj nowe zam√≥wienie
                </h3>
                <Form>
                    <FormGroup>
                        <Label for="name">Name</Label>
                        <Input
                            type="text"
                            name="name"
                            value={this.state.activeItem.name}
                            placeholder="Enter Customer Name"
                        />
                    </FormGroup>
                    <FormGroup>
                        <Label for="surname">Surname</Label>
                        <Input
                            type="text"
                            name="surname"
                            value={this.state.activeItem.surname}
                            placeholder="Enter Customer Surname"
                        />
                    </FormGroup>
                    <FormGroup check>
                        <Label for="age">Age</Label>
                        <Input
                            type="number"
                            name="age"
                            value={this.state.activeItem.age}
                            placeholder="Enter Customer age"
                        />
                    </FormGroup>
                </Form>
            </div>
        );
    }

}

export default AddMedicineOrder;
